import React from "react";
import { Link } from "react-router-dom";
function Navbar() {
  return (
    <div className="Navbar">
      <Link to="/" className="Navbar-logo">
        ECI
      </Link>
      <img src="logo.png" alt="logo" />
    </div>
  );
}
export default Navbar;
